import React, { Component } from 'react';
import ReactSearchBox from 'react-search-box';
import './SearchBar.css';

export default class SearchBar extends Component {
  data = [
    {
      key: 'john',
      value: 'John Doe',
    },
    {
      key: 'jane',
      value: 'Jane Doe',
    },
    {
      key: 'mary',
      value: 'Mary Phillips',
    },
    {
      key: 'robert',
      value: 'Robert',
    },
    {
      key: 'karius',
      value: 'Karius',
    },
  ]

  render() {
    return (
        <div className = "reactSearchBox">
            <ReactSearchBox
                placeholder="Search"
                inputBoxFontSize = "2em"
                data={this.data}
                callback={record => console.log(record)}
            />
      </div>
    )
  }
}
